import DFS from './dfs';
import BFS from './bfs';

function UIcontrol(){


    return{
        input : function(){
            let e = document.getElementById("algo");
            console.log(e.value);
            if(e.value === '3'){
                return 1;
            }else return 0;
        }
    }
}

export default UIcontrol;
